    "name": "Peter Fernandes Wanke",
    "institution": "UFRJ",
    "about": "Possui Doutorado em Engenharia de Produo pela Universidade Federal do Rio de Janeiro (2003) e Mestrado em Engenharia de Produo pela Universidade Federal do Rio de Janeiro (1998), ambos pelo PEP-COPPE/UFRJ, e Graduao em Engenharia de Produo pela Universidade Federal do Rio de Janeiro (1996) pela POLI/UFRJ. Atualmente  Professor Associado III do Instituto COPPEAD de Administrao da Universidade Federal do Rio de Janeiro, onde coordena o Programa de Doutorado. Possui mais de 100 artigos publicados em journals internacionais com fator de impacto. Foi chefe de rea temtica do EnANPAD no binio 2006/2007.  membro do Comit Cientfico da rea de Gesto de Operaes e Logstica do EnANPAD desde 2014.  Associate Editor do peridico Socio-Economic Planning Sciences (Elsevier) e membro do Editorial Board do peridico Tourism Economics (SAGE). Possui experincia na coordenao de projetos de pesquisa no mbito do Centro de Estudos em Logstica, Infraestrutura e Gesto (CELIG) / Ctedra Ipiranga de Estratgia de Operaes do COPPEAD/UFRJ e do Programa Jovem Cientista do Nosso Estado da FAPERJ. Atualmente  coordenador do projeto de Mobilidade Urbana da FAPERJ desde 2015. Foi bolsista DTI-A do CNPq no perodo 01/06/2013 a 31/05/2014 analisando a eficincia dos aeroportos brasileiros.  revisor de mais de 60 peridicos nacionais e internacionais, alm de consultor ad hoc da CAPES e da Cmara de Fomento  Pesquisa da Pr-reitoria de Ps-graduao e Pesquisa da UFRJ. Foi visiting scholar do Departamento de Marketing e Logstica da Ohio State University (2003). Tem experincia na aplicao de tcnicas de business analytics no apoio  tomada de deciso e benchmarking em diferentes reas da administrao como logstica, cadeias de suprimento, transportes, infraestrutura, energia, educao e banking em diferentes pases do mundo.",
